Sure, here is a basic structure of an HTML document that you can use as a starting point. It includes some CSS styles and JavaScript functionality for interactivity. 

```html
<!DOCTYPE html>
<html>
    <head>
        <title>Rental Property Webpage</title>
        <style>
            body {
                font-family: Arial, sans-serif;
            }
            
            .property-card {
                width: 300px;
                border: 1px solid #ddd;
                padding: 20px;
                margin: 20px;
                box-shadow: 5px 5px 15px 0px rgba(0,0,0,.1);
            }
            
            .property-card img {
                width: 100%;
            }
        </style>
    </head>
    
    <body>
        <div class="property-card" id="property1">
            <img src="https://via.placeholder.com/350x200" alt="">
            <h2>Rental Property 1</h2>
            <p>Some text about the rental property goes here...</p>
        </div>
        
        <script>
            document.getElementById("property1").addEventListener('mouseover', function() {
                this.style.color = "blue";
            });
            
            document.getElementById("property1").addEventListener('mouseout', function() {
                this.style.color = "";
            });
        </script>
    </body>
</html>
```
This is a simple example where the color of the property card changes when you hover over it. You can add more complex functionalities using JavaScript or integrate with any backend services for data management and renting processes. Please replace "https://via.placeholder.com/350x200" with actual image URLs to display your rental properties.
